import React, {useState, useEffect} from 'react';
import SearchFoodBar from './SearchFoodBar';
import FoodItemsList from './FoodItemsList';
import searchpage from "../CSS/searchpage.css"

function SearchResultsPage ({
    currentUser,
    setFoodItem, 
    foodItem, 
    selectedMeal, 
    setTotalCaloriesIAte, 
    setSearchedItems, 
    searchedItems, 
    currentFoodResponse, 
    setCurrentUser,
    }) {

    //check user login 
    useEffect(() => {
        fetch('/check_session')
        .then(response => {
            if(response.ok) {
            response.json()
            .then(user => setCurrentUser(user))
            }
        })
    }, [])

    return(
        <div className="search-bg-image" >
            <div className="search-page">
            <SearchFoodBar 
                setSearchedItems={setSearchedItems} 
                />
            <FoodItemsList 
                setSearchedItems={setSearchedItems}
                setTotalCaloriesIAte={setTotalCaloriesIAte} 
                foodItem={foodItem} 
                setFoodItem={setFoodItem} 
                selectedMeal={selectedMeal}
                searchedItems={searchedItems}  
                currentUser={currentUser} 
                currentFoodResponse={currentFoodResponse} />
            </div>
        </div>
    )
}

export default SearchResultsPage;
